To find out what day a year from today will be, we can use the following formula:

```java
public class Main {
  public static void main(String[] args) {
    Calendar today = Calendar.getInstance();
    int currentYear = today.get(Calendar.YEAR);
    int currentMonth = today.get(Calendar.MONTH) + 1;
    int currentDay = today.get(Calendar.DAY_OF_MONTH);

    Calendar futureDate = Calendar.getInstance();
    futureDate.set(Calendar.YEAR, currentYear);
    futureDate.set(Calendar.MONTH, currentMonth);
    futureDate.set(Calendar.DAY_OF_MONTH, currentDay);
    futureDate.add(Calendar.YEAR, 1);

    System.out.println("A year from today, it will be: " + futureDate.get(Calendar.DAY_OF_WEEK));
  }
}
```

This code snippet uses the `java.util.Calendar` class to get the current date and add one year to it. Then, it prints the day of the week for the future date. Note that this code assumes that the current date is today, and it does not take into account any leap year adjustments.

To find the day of the week for a specific date, you can replace the `Calendar.DAY_OF_WEEK` constant with the desired day of the week (e.g., `Calendar.FRIDAY` for Friday).
